import React, { useEffect, useState } from 'react';
import axios from 'axios';
import CollapsableNavbar from "../components/CollapsableNavbar"; // Pretpostavimo da imate komponentu za navigaciju

const PopisZivotinjaPage = () => {
    const [zivotinje, setZivotinje] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:3000/api/zivotinje")
            .then(res => {
                setZivotinje(res.data);
            })
            .catch(err => console.error("Greška pri dohvatu podataka o životinjama: ", err));
    }, []);

    return (
        <div>
            <CollapsableNavbar />
            <h1>Popis Životinja</h1>
            <table className="table table-striped table-hover">
                <thead>
                    <tr>
                        <th scope="col">Naziv životinje</th>
                        <th scope="col">Opis</th>
                    </tr>
                </thead>
                <tbody>
                    {zivotinje.map((zivotinja, index) => (
                        <tr key={index}>
                            <td>{zivotinja.naziv_zivotinje}</td>
                            <td>{zivotinja.opis_zivotinje}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default PopisZivotinjaPage;
